def main():    """    Entry point for Day 5, Part 2    416631595955320 - too high    409067493678053 - too high    367899984917516    :return: Exit code    """    unchecked_ranges = read_input('input.txt')    master_ranges = [unchecked_ranges.pop(0)]    while unchecked_ranges:        range_item = unchecked_ranges.pop(0)        checked = False        for i in range(len(master_ranges)):            master_range = master_ranges[i]            # New range expands downward            if (range_item[0] < master_range[0]) and (master_range[0] <= range_item[1] <= master_range[1]):                unchecked_ranges.append((min(range_item[0], master_range[0]), master_range[1]))                checked = True            # New range expands upward            elif (range_item[1] > master_range[1]) and (master_range[0] <= range_item[0] <= master_range[1]):                unchecked_ranges.append((master_range[0], max(range_item[1], master_range[1])))                checked = True            # New range is a complete superset            elif (range_item[0] < master_range[0]) and (range_item[1] > master_range[1]):                unchecked_ranges.append((range_item[0], range_item[1]))                checked = True            # New range is a complete subset            elif (master_range[0] <= range_item[0] <= master_range[1]) and (master_range[0] <= range_item[1] <= master_range[1]):                checked = True                break            if checked:                master_ranges.pop(i)                break        if not checked:            master_ranges.append(range_item)    modified = []    for master_range in master_ranges:        modified.append((master_range[0] // 1000000000000, master_range[1] // 1000000000000))    total = 0    for master_range in master_ranges:        total += master_range[1] - master_range[0] + 1    print('Num of fresh ingredient IDs: ' + str(total))def read_input(filename):    ranges = []    with open(filename, 'r') as file:        for line in file:            if '-' in line:                ranges.append(tuple(map(int, line.split('-'))))    return rangesif __name__ == "__main__":    main()